results:
  Age:
    code:
    - - .isComplete('Age')
      - Passed
    - - .isNonNegative('Age')
      - Failed
  Gender:
    code:
    - - .isComplete('Gender')
      - Passed
    - - .isContainedIn('Gender', ['Male', 'Female'])
      - Failed
  id:
    code:
    - - .isComplete('id')
      - Passed
    - - .isNonNegative('id')
      - Passed
    - - .isUnique('id')
      - Passed
